import React from 'react';
import {
    GridItemContainer,
    GridText,
    GridImg
} from './GridItemElements';
import CODING_ICON from "../../images/coding.svg"


const GridItem = () => {
    return (
        <>
            <GridItemContainer>
                <GridText>Example!</GridText>
                <GridImg src={CODING_ICON} />
            </GridItemContainer>
        </>
    )
}

export default GridItem;
